import pdfMake, { fonts } from 'pdfmake/build/pdfmake'
import pdfFont from 'pdfmake/build/vfs_fonts'

function vendasPdf(venda) {
    pdfMake.vfs = pdfFont.pdfMake.vfs
    const reportTitle = [
        {
            columns: [
                {
                    image: 'data:image/png;base64,',
                    width: 70,
                    height: 70,
                },
                {
                    text: 'Relatório de Vendas',
                    fontSize: 18,
                    bold: true,
                    margin: [0, 15, 0, 0],
                    alignment: 'center'
                }
            ]
        }
    ];
    const data = venda.map((venda) => {
        return [
            {
                text: venda.id,
                style: 'tableHeader',
                fontSize: 10,
                margin: [15, 5, 0, 0]
            },
            {
                text: (venda.dt_Venda.split('T')[0]).split('-').reverse().join('/'),
                style: 'tableHeader',
                fontSize: 10,
                margin: [15, 5, 0, 0]
            },
            {
                text: venda.nome_Pessoa,
                style: 'tableHeader',
                fontSize: 10,
                margin: [15, 5, 0, 0]
            },
            {
                text: 'R$ ' + (venda.vr_Total.toFixed(2)).toLocaleString('pt-BR'),
                style: 'tableHeader',
                fontSize: 10,
                margin: [15, 5, 0, 0]
            }
        ]
    })

    const details = [
        {
            table: {
                headerRows: 1,
                widths: ['*', '*', '*', '*'],
                body: [
                    [
                        {
                            text: 'Código',
                            style: 'tableHeader',
                            fontSize: 12,
                            margin: [5, 25, 0, 0]
                        },
                        {
                            text: 'Data de Venda',
                            style: 'tableHeader',
                            fontSize: 12,
                            margin: [5, 25, 0, 0]
                        },
                        {
                            text: 'Nome completo ',
                            style: 'tableHeader',
                            fontSize: 12,
                            margin: [5, 25, 0, 0]
                        },
                        {
                            text: 'Valor total',
                            style: 'tableHeader',
                            fontSize: 12,
                            margin: [5, 25, 0, 0]
                        }
                    ],
                    ...data
                ]
            },

            layout: 'headerLineOnly'
        }
    ]


    const docDefinitions = {
        pageSize: 'A4',
        pageMargins: [15, 50, 15, 40],

        header: [reportTitle],
        content: [details],

    }
    pdfMake.createPdf(docDefinitions).open()
}
export default vendasPdf